import React from "react";

const About = () => {
  return(
    <div>
      <h1 className="text-4xl mt-24">Karur Gold Finance</h1>
      <p>It was established in May, 2006 as a Registered Company in Chennai, Registered Office, at 6th Floor “Jhaver Plaza”, 1-A Nungambakkam High Road, Chennai – 600 034.</p>
    </div>
  )
}

export default About;
